import Navbar from "../Components/Navbar";

const Layout = (props) => (
  <div>
    <head>
      <title>Hellow-NextJS</title>
      <link
        href="https://unpkg.com/tailwindcss@^1.0/dist/tailwind.min.css"
        rel="stylesheet"
      />
    </head>
    <Navbar />
    {props.children}
  </div>
);

export default Layout;
